import React from 'react';
import './Course.css'
const Course = (props) => {
    const {name, price,description, sessions,img} = props.course;
    return (
        <div className="course-info shadow-lg">
            <img src={img} alt="" className="img-fluid image-course"></img>
            <h4 className="price">${price}</h4>
            <div className="container">
            <h3 className="course-name mt-5 fw-bold">{name}</h3>
            <p>{description}</p>
            <p><span className="text-red fs-4 fw0bold">{sessions} </span>sessions</p>
            
            </div>
        </div>
    );
};

export default Course;
